import React, { Component } from 'react'
import { Input,Button } from 'antd';
import 'antd/dist/antd.css'

export default class Person extends Component {
    render() {
        return (
            <div>
                &nbsp;<Input type='text' style={{ width: 120 }} placeholder="输入名字" ref={ c=>this.nameNode = c} /><br/><br/>
                &nbsp;<Input type='password' style={{ width: 120 }} placeholder="输入年龄" ref = {c => this.ageNode = c}  /><br/><br/>
                &nbsp;<Button type="primary">添加</Button>
            </div>
        )
    }
}
